import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Typography, Grid, Card, CardContent, Button, CircularProgress, TextField, Box } from '@mui/material';

// Componente principal
function App() {
  const [status, setStatus] = useState([]);
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [userForm, setUserForm] = useState({ nome: '', email: '', senha: '' });
  const [ticketForm, setTicketForm] = useState({ userId: '', statusId: '' });

  // Função para pegar os status e os usuários do backend
  useEffect(() => {
    // Pega os status de recarga
    axios.get('http://localhost:5000/api/status')
      .then((response) => {
        setStatus(response.data);
      })
      .catch((error) => {
        setError('Erro ao carregar os dados');
      });

    // Pega os usuários do backend
    axios.get('http://localhost:5000/api/users')
      .then((response) => {
        setUsers(response.data);
      })
      .catch((error) => {
        setError('Erro ao carregar os usuários');
      });

    setLoading(false);
  }, []);

  // Função para adicionar um novo usuário
  const addUser = () => {
    axios.post('http://localhost:5000/api/users', userForm)
      .then((response) => {
        alert('Usuário adicionado com sucesso!');
        setUserForm({ nome: '', email: '', senha: '' });
      })
      .catch((error) => {
        setError('Erro ao adicionar usuário');
      });
  };

  // Função para criar um novo ticket de recarga
  const createTicket = () => {
    axios.post('http://localhost:5000/api/recarga-tickets', ticketForm)
      .then((response) => {
        alert('Ticket de recarga criado com sucesso!');
        setTicketForm({ userId: '', statusId: '' });
      })
      .catch((error) => {
        setError('Erro ao criar o ticket');
      });
  };

  return (
    <Container>
      <Typography variant="h3" gutterBottom align="center">
        Monitoramento de Recarga de Veículos Elétricos
      </Typography>

      {loading ? (
        <CircularProgress color="primary" />
      ) : error ? (
        <Typography color="error" align="center">
          {error}
        </Typography>
      ) : (
        <Grid container spacing={3} justifyContent="center">
          {/* Formulário para Adicionar Usuário */}
          <Grid item xs={12}>
            <Typography variant="h4" gutterBottom>
              Adicionar Usuário
            </Typography>
            <TextField
              label="Nome"
              fullWidth
              value={userForm.nome}
              onChange={(e) => setUserForm({ ...userForm, nome: e.target.value })}
              margin="normal"
            />
            <TextField
              label="Email"
              fullWidth
              value={userForm.email}
              onChange={(e) => setUserForm({ ...userForm, email: e.target.value })}
              margin="normal"
            />
            <TextField
              label="Senha"
              type="password"
              fullWidth
              value={userForm.senha}
              onChange={(e) => setUserForm({ ...userForm, senha: e.target.value })}
              margin="normal"
            />
            <Button variant="contained" color="primary" fullWidth onClick={addUser}>
              Adicionar Usuário
            </Button>
          </Grid>

          {/* Listagem de Status de Recarga */}
          <Grid item xs={12}>
            <Typography variant="h4" gutterBottom>
              Status de Recarga
            </Typography>
            <Grid container spacing={3}>
              {status.map((veiculo) => (
                <Grid item xs={12} sm={6} md={4} key={veiculo.id}>
                  <Card variant="outlined">
                    <CardContent>
                      <Typography variant="h5" component="div">
                        {veiculo.nome}
                      </Typography>
                      <Typography color="textSecondary">Status: {veiculo.status}</Typography>
                      <Typography color="textSecondary">Fonte de Energia: {veiculo.fonteEnergia}</Typography>
                      <Typography color="textSecondary">Hora de Início: {veiculo.horaInicio}</Typography>
                    </CardContent>
                  </Card>
                </Grid>
              ))}
            </Grid>
          </Grid>

          {/* Formulário para Criar Ticket de Recarga */}
          <Grid item xs={12}>
            <Typography variant="h4" gutterBottom>
              Criar Ticket de Recarga
            </Typography>
            <TextField
              select
              label="Selecione o Usuário"
              fullWidth
              value={ticketForm.userId}
              onChange={(e) => setTicketForm({ ...ticketForm, userId: e.target.value })}
              SelectProps={{
                native: true,
              }}
              margin="normal"
            >
              <option value="">Selecione um usuário</option>
              {users.map((user) => (
                <option key={user.id} value={user.id}>
                  {user.nome} - {user.email}
                </option>
              ))}
            </TextField>

            <TextField
              select
              label="Selecione o Status"
              fullWidth
              value={ticketForm.statusId}
              onChange={(e) => setTicketForm({ ...ticketForm, statusId: e.target.value })}
              SelectProps={{
                native: true,
              }}
              margin="normal"
            >
              <option value="">Selecione um status</option>
              {status.map((statusItem) => (
                <option key={statusItem.id} value={statusItem.id}>
                  {statusItem.nome} - {statusItem.status}
                </option>
              ))}
            </TextField>

            <Button variant="contained" color="primary" fullWidth onClick={createTicket}>
              Criar Ticket
            </Button>
          </Grid>
        </Grid>
      )}
    </Container>
  );
}

export default App;
